import axios from "axios";
import React, { useState, useRef } from "react";
import {
  Cabecalho,
  Botao,
  SeparadorDiv,
  SeparadorDivDois,
  LogoMarca,
  CampoCadastroInstrumento,
  InputUser,
  LabelInput,
  CampoImagemCadastroInstrumento,
  CampoJuntarDiv,
} from "../EstiloPaginas/Style";
import { useNavigate } from "react-router-dom";

const servico = axios.create({
  baseURL: "http://localhost:8080",
});

function Cadastroinstrumento() {
  let navigate = useNavigate();

  const modeloRef = useRef();
  const marcaRef = useRef();
  const tipoRef = useRef();
  const corRef = useRef();
  const circuitoRef = useRef();
  const capaRef = useRef();
  const marcaDaCapaRef = useRef();
  const cordaRef = useRef();
  const marcaDaCorda = useRef();
  const [intrumentos, setIntrumentos] = useState([]);

  async function handleCadastrarInstrumento() {
    const instrumentoMusical = new InstrumentoMusical(
      modeloRef.current.value,
      marcaRef.current.value,
      tipoRef.current.value,
      corRef.current.value,
      circuitoRef.current.value,
      capaRef.current.value,
      marcaDaCapaRef.current.value,
      cordaRef.current.value,
      marcaDaCorda.current.value
    );
    const { data } = await servico.post(
      "/instrumentoMusical",
      instrumentoMusical
    );
  }

  return (
    <>
      <header>
        <Cabecalho>
          <SeparadorDiv></SeparadorDiv>
          <LogoMarca img src={require("../imagens/target-Music.png")}></LogoMarca>
          <SeparadorDivDois></SeparadorDivDois>
          <SeparadorDiv></SeparadorDiv>
          <SeparadorDiv></SeparadorDiv>
          <Botao
            onClick={() => {
              navigate("/");
            }}
          >
            Home
          </Botao>
          <SeparadorDiv></SeparadorDiv>
        </Cabecalho>
      </header>

      <body>

         <div></div>   
        <CampoJuntarDiv>
        <CampoImagemCadastroInstrumento img src={require("../imagens/violao.png")}>
        </CampoImagemCadastroInstrumento>
        <CampoCadastroInstrumento>
          <LabelInput htmlFor="">Tipo do instrumento: </LabelInput>
          <InputUser type="text" />
          <br />
          <br />
          <br />
          <LabelInput htmlFor="">Marca do instrumento: </LabelInput>
          <InputUser type="text" />
          <br />
          <br />
          <br />
          <LabelInput htmlFor="">Modelo do instrumento: </LabelInput>
          <InputUser type="text" />
          <br />
          <br />
          <br />
          <LabelInput htmlFor="">Cor do instrumento: </LabelInput>
          <InputUser type="text" />
          <br />
          <br />
          <br />
          <LabelInput htmlFor="">Circuito do instrumento: </LabelInput>
          <InputUser type="text" />
          <br />
          <br />
          <br />
          <LabelInput htmlFor="">Capa do instrumento: </LabelInput>
          <InputUser type="text" />
          <br />
          <br />
          <br />
          <LabelInput htmlFor="">Marca da Capa: </LabelInput>
          <InputUser type="text" />
          <br />
          <br />
          <br />
          <LabelInput htmlFor="">Corda do instrumento: </LabelInput>
          <InputUser type="text" />
          <br />
          <br />
          <br />
          <LabelInput htmlFor="">Marca da corda: </LabelInput>
          <InputUser type="text" />
        </CampoCadastroInstrumento>
        </CampoJuntarDiv>
      </body>
    </>
  );
}

export default Cadastroinstrumento;

class InstrumentoMusical {
  modelo;
  marca;
  tipo;
  cor;
  circuito;
  capa;
  marcaDaCapa;
  corda;
  marcaDaCorda;

  constructor(
    modelo,
    marca,
    tipo,
    cor,
    circuito,
    capa,
    marcaDaCapa,
    corda,
    marcaDaCorda
  ) {
    this.modelo = modelo;
    this.marca = marca;
    this.tipo = tipo;
    this.cor = cor;
    this.circuito = circuito;
    this.capa = capa;
    this.marcaDaCapa = marcaDaCapa;
    this.corda = corda;
    this.marcaDaCorda = marcaDaCorda;
  }
}
